import { Box, Heading } from '@chakra-ui/react';

const ThreatMap = () => {
  return (
    <Box p={4} borderRadius="lg" boxShadow="base" bg="white">
      <Heading size="md" mb={4}>Global Threat Map</Heading>
      {/* Add map visualization component here */}
      <Box
        h="300px"
        bg="gray.100"
        borderRadius="md"
        display="flex"
        alignItems="center"
        justifyContent="center"
      >
        Map Visualization Placeholder
      </Box>
    </Box>
  );
};

export default ThreatMap;
